import React, { useEffect, useState } from 'react';
import { withRouter } from 'react-router-dom';
import './FrontPage.css';

function FrontPage({user_cpu, user_gpu, user_ram, onChange}) {
  let id = "inputs";
  return (
    <div className={"App"}>
      <div id={id}>
        <form>
          <label htmlFor='user_cpu'>User CPU</label><br/>
          <input
            type='text'
            id='user_cpu'
            name='user_cpu'
            placeholder='Enter your CPU here'
            value={user_cpu}
            onChange= {onChange}
          />
          <br/>
          <label htmlFor='user_gpu'>User GPU</label><br/>
          <input
            type='text'
            id='user_gpu'
            name='user_gpu'
            placeholder='Enter your GPU here'
            value={user_gpu}
            onChange= {onChange}
          />
          <br/>
          <label htmlFor='user_ram'>User RAM</label><br/>
          <input
            type='text'
            id='user_ram'
            name='user_ram'
            placeholder='Enter your RAM here'
            value={user_ram}
            onChange= {onChange}
          />
          <br/>
          <input type='submit' value='Submit' />
        </form>
      </div>
    </div>
  );
}

export default withRouter(FrontPage);
